  - - !str 13
    - info_germ
    - "Specifies the short melody from which the piece is generated. You can think \
      of it as the \xe2\x80\x9cshape\xe2\x80\x9d of the fractal. The germ should be \
      a series of notes, seperated by spaces.\n\nEach note must have the following:\n\
      \n* \"Pitch Class\":http://en.wikipedia.org/wiki/Pitch_class: A letter name \
      (A-G), optionally followed by an accidental (bb, b, # or x).\n* Octave: A number \
      from 0 to 9 specifying which octave this note is in. The \"Acoustical Society \
      of America\xe2\x80\x99s octave designation system\":http://en.wikipedia.org/wiki/Scientific_pitch_notation \
      is used. Each octave runs from C to B. C4 to B4 is the octave from middle C \
      to the B above middle C.\n\nIn addition, you can optionally include the following:\n\
      \n* Rhythmic Duration: A fraction indicating how long the note should last. \
      For example, 1/4 indicates a quarter note, 3/8 a dotted quarter note and 1/12 \
      indicates one note of an eighth note triplet. If no duration is given, the duration \
      of the previous note is used. The first note will be a quarter note if no duration \
      is given.\n* Volume: One of PPP, PP, P, MP, MF, F, FF or FFF. If none is given, \
      the volume of the previous note is used. The first note will be MF if no volume \
      is given.\n\nIf you include a rhythmic duration or volume, use a comma to seperate \
      it from the pitch information."
